import Rooms from './Rooms';

export default function Landing() {
    return (
        <div className="container">
            <div className="item floorplan">
                <div style={{ width: "100%", height: "100%" }}>
                    <svg
                    xmlns="http://www.w3.org/2000/svg"
                    id="Layer_1"
                    data-name="Layer 1"
                    viewBox="0 0 496.5 640.5"
                    ></svg>
                </div>
            </div>
        </div>
    );
}
